window = 756  # 3 years
step = 5      # 5-day step

os.makedirs(output_folder, exist_ok=True)

# === STEP 1: Download historical price data ===
price_data = yf.download(tickers, start="2010-01-01", auto_adjust=True, progress=True)["Close"]
price_data = price_data.dropna(axis=1)
valid_tickers = list(price_data.columns)

# === STEP 2: Industry mapping ===
industries = {}
for ticker in tqdm(valid_tickers, desc="Fetching industry info"):
    try:
        info = yf.Ticker(ticker).info
        industries[ticker] = info.get("industry", "Unknown")
    except:
        industries[ticker] = "Unknown"

# === STEP 3: Group by industry ===
industry_groups = {}
for ticker, industry in industries.items():
    industry_groups.setdefault(industry, []).append(ticker)

# === STEP 4: Cointegration tests per industry ===
all_results = []
date_str = datetime.now().strftime("%Y-%m-%d")

for industry, group in tqdm(industry_groups.items(), desc="Industries"):
    group = [t for t in group if t in price_data.columns]
    if len(group) < 2:
        continue

    sub_data = price_data[group].dropna(axis=1)
    if sub_data.shape[1] < 2:
        continue

    corr_matrix = sub_data.corr()
    industry_results = []

    for t1, t2 in tqdm(list(combinations(sub_data.columns, 2)), desc=f"{industry}", leave=False):
        corr = corr_matrix.loc[t1, t2]
        if corr < 0.8:
            continue

        p_values = []
        for i in range(0, len(sub_data) - window, step):
            x = sub_data[t1].iloc[i:i+window]
            y = sub_data[t2].iloc[i:i+window]
            if x.isnull().any() or y.isnull().any():
                continue
            try:
                with warnings.catch_warnings():
                    warnings.simplefilter("ignore")
                    _, p, _ = coint(x, y)
                p_values.append(p)
            except:
                continue

        if p_values:
            avg_p = np.mean(p_values)
            row = {
                "Ticker Pair": f"{t1}/{t2}",
                "Industry": industry,
                "Correlation": round(corr, 4),
                "Avg P-Value": round(avg_p, 5),
                "Tests Run": len(p_values)
            }
            industry_results.append(row)
            all_results.append(row)

    # Save partial results for this industry
    if industry_results:
        df_partial = pd.DataFrame(industry_results)
        partial_path = os.path.join(output_folder, f"{industry.replace('/', '_')}_results_{date_str}.csv")
        df_partial.sort_values("Avg P-Value", inplace=True)
        df_partial.to_csv(partial_path, index=False)

# === STEP 5: Save combined results ===
if all_results:
    df_all = pd.DataFrame(all_results)
    df_all.sort_values("Avg P-Value", inplace=True)
    final_csv_path = os.path.join(output_folder, f"cointegration_results_{date_str}.csv")
    df_all.to_csv(final_csv_path, index=False)

    print(f"\nCointegration results saved to:\n{final_csv_path}")
